{
  "translationLines": [
    {
      "lineNumber": 104571,
      "originalJapaneseLine": "「してるしてる」",
      "translatedEnglishLine": "\"I am, I am.\""
    },
    {
      "lineNumber": 104572,
      "originalJapaneseLine": "「……本当に？」",
      "translatedEnglishLine": "\"...Really?\""
    },
    {
      "lineNumber": 104573,
      "originalJapaneseLine": "「うむ、俺、レイラさんに嘘つかない」",
      "translatedEnglishLine": "\"Yes, I don't lie to you, Layla.\""
    },
    {
      "lineNumber": 104574,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 104575,
      "originalJapaneseLine": "「そうねぇ……",
      "translatedEnglishLine": "\"Well then...\""
    },
    {
      "lineNumber": 104576,
      "originalJapaneseLine": "　どこかで妥協しないと後が怖いし……」",
      "translatedEnglishLine": "If we don't compromise somewhere, what comes next will be scary...\""
    },
    {
      "lineNumber": 104577,
      "originalJapaneseLine": "「おおっ！　なら！」",
      "translatedEnglishLine": "\"Oh! Then!\""
    },
    {
      "lineNumber": 104578,
      "originalJapaneseLine": "「はいはい、観念したから、",
      "translatedEnglishLine": "\"Alright, alright, since you've resigned yourself,"
    },
    {
      "lineNumber": 104579,
      "originalJapaneseLine": "　早く服を脱いで」",
      "translatedEnglishLine": "hurry and take off your clothes.\""
    },
    {
      "lineNumber": 104580,
      "originalJapaneseLine": "「わーいわーい！」",
      "translatedEnglishLine": "\"Yay, yay!\""
    },
    {
      "lineNumber": 104581,
      "originalJapaneseLine": "「はあ、いいお湯ねぇ……」",
      "translatedEnglishLine": "\"Ah, the water feels nice...\""
    },
    {
      "lineNumber": 104582,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\".........\""
    },
    {
      "lineNumber": 104583,
      "originalJapaneseLine": "「なあ、レイラさん」",
      "translatedEnglishLine": "\"Hey, Layla.\""
    },
    {
      "lineNumber": 104584,
      "originalJapaneseLine": "「んー？　どうしたの？」",
      "translatedEnglishLine": "\"Hm? What's wrong?\""
    },
    {
      "lineNumber": 104585,
      "originalJapaneseLine": "「何故俺は目隠しをしなければならんのだ？」",
      "translatedEnglishLine": "\"Why do I have to wear a blindfold?\""
    },
    {
      "lineNumber": 104586,
      "originalJapaneseLine": "「だって、見られたら恥ずかしいじゃない」",
      "translatedEnglishLine": "\"Because it would be embarrassing if you saw me.\""
    },
    {
      "lineNumber": 104587,
      "originalJapaneseLine": "「むう……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 104588,
      "originalJapaneseLine": "「ちなみに……",
      "translatedEnglishLine": "\"By the way...\""
    },
    {
      "lineNumber": 104589,
      "originalJapaneseLine": "　今も剣を持ってるのか？」",
      "translatedEnglishLine": "\"Are you still holding the sword now?\""
    },
    {
      "lineNumber": 104590,
      "originalJapaneseLine": "「ええ、もちろん。",
      "translatedEnglishLine": "\"Yes, of course."
    },
    {
      "lineNumber": 104591,
      "originalJapaneseLine": "　ランス君が変なことしたら、これで……」",
      "translatedEnglishLine": "If Rance-kun does something strange, with this...\""
    },
    {
      "lineNumber": 104592,
      "originalJapaneseLine": "「うぐ、これで、なんだよ……",
      "translatedEnglishLine": "\"Ugh, with this, huh...\""
    },
    {
      "lineNumber": 104593,
      "originalJapaneseLine": "　怖いな……」",
      "translatedEnglishLine": "\"That's scary...\""
    },
    {
      "lineNumber": 104594,
      "originalJapaneseLine": "「ほら、背中流すからこっちにいらっしゃい。",
      "translatedEnglishLine": "\"Come on, I'll wash your back, so come over here."
    },
    {
      "lineNumber": 104595,
      "originalJapaneseLine": "　手を引いてあげるから」",
      "translatedEnglishLine": "I'll hold your hand and guide you.\""
    },
    {
      "lineNumber": 104596,
      "originalJapaneseLine": "「こっちにいらっしゃい、か……",
      "translatedEnglishLine": "\"'Come over here', huh...\""
    },
    {
      "lineNumber": 104597,
      "originalJapaneseLine": "　なんかいい響きなのに、",
      "translatedEnglishLine": "It sounds nice, but"
    },
    {
      "lineNumber": 104598,
      "originalJapaneseLine": "　ちっともいい思いを出来る気がしない……」",
      "translatedEnglishLine": "I don't feel like I'll have any good experiences at all...\""
    },
    {
      "lineNumber": 104599,
      "originalJapaneseLine": "「はー、サッパリしたわね」",
      "translatedEnglishLine": "\"Ah, I feel refreshed.\""
    },
    {
      "lineNumber": 104600,
      "originalJapaneseLine": "「おお、おお……",
      "translatedEnglishLine": "\"Oh, oh...\""
    },
    {
      "lineNumber": 104601,
      "originalJapaneseLine": "　本当にちっともいい思い出来なかった……」",
      "translatedEnglishLine": "I really didn't have any good experiences at all...\""
    },
    {
      "lineNumber": 104602,
      "originalJapaneseLine": "（なんだか親戚の子とお風呂入った気分ね）",
      "translatedEnglishLine": "(Somehow, it feels like I took a bath with a relative's child.)"
    },
    {
      "lineNumber": 104603,
      "originalJapaneseLine": "「ほらほら、ランス君。",
      "translatedEnglishLine": "\"Hey, hey, Rance-kun."
    },
    {
      "lineNumber": 104604,
      "originalJapaneseLine": "　そんなに拗ねないでよ」",
      "translatedEnglishLine": "Don't sulk so much.\""
    },
    {
      "lineNumber": 104605,
      "originalJapaneseLine": "「あ、アイスがあるわよ、食べる？」",
      "translatedEnglishLine": "\"Ah, there's ice cream, want some?\""
    },
    {
      "lineNumber": 104606,
      "originalJapaneseLine": "「いや、いい、部屋に戻る……",
      "translatedEnglishLine": "\"No, I'm fine, I'll go back to my room...\""
    },
    {
      "lineNumber": 104607,
      "originalJapaneseLine": "　はあ……」",
      "translatedEnglishLine": "\"Sigh...\""
    },
    {
      "lineNumber": 104608,
      "originalJapaneseLine": "「ジュリアちゃん☆　行っきまーーす♪」",
      "translatedEnglishLine": "\"Julia-chan☆ Here I goーー♪\""
    },
    {
      "lineNumber": 104609,
      "originalJapaneseLine": "「ん？　ジュリア、お前来ていたのか」",
      "translatedEnglishLine": "\"Hm? Julia, you were here?\""
    },
    {
      "lineNumber": 104610,
      "originalJapaneseLine": "「あ、ランスちゃんだー。",
      "translatedEnglishLine": "\"Ah, it's Rance-chan."
    },
    {
      "lineNumber": 104611,
      "originalJapaneseLine": "　うん、たまにこうして来て、",
      "translatedEnglishLine": "Yeah, I come here sometimes like this,"
    },
    {
      "lineNumber": 104612,
      "originalJapaneseLine": "　小っちゃい子達の面倒見てるのよ」",
      "translatedEnglishLine": "and take care of the little kids.\""
    },
    {
      "lineNumber": 104613,
      "originalJapaneseLine": "「ふーん、そか、偉いな。",
      "translatedEnglishLine": "\"Hmm, I see, that's admirable."
    },
    {
      "lineNumber": 104614,
      "originalJapaneseLine": "　ちゃんと千姫の言うこと聞くんだぞ」",
      "translatedEnglishLine": "Make sure you listen to Senhime properly.\""
    },
    {
      "lineNumber": 104615,
      "originalJapaneseLine": "「えへへ、まっかせて！",
      "translatedEnglishLine": "\"Hehe, leave it to me!"
    },
    {
      "lineNumber": 104616,
      "originalJapaneseLine": "　さあ、リセットちゃん、あやとりの続きしよー」",
      "translatedEnglishLine": "Now, Reset-chan, let's continue playing cat's cradle.\""
    },
    {
      "lineNumber": 104617,
      "originalJapaneseLine": "「うんっ」",
      "translatedEnglishLine": "\"Yeah!\""
    },
    {
      "lineNumber": 104618,
      "originalJapaneseLine": "（ほとんど遊びに来てるだけなんじゃないのか？）",
      "translatedEnglishLine": "(Aren't you mostly just coming here to play?)"
    },
    {
      "lineNumber": 104619,
      "originalJapaneseLine": "（ま、そんなところだ）",
      "translatedEnglishLine": "(Well, something like that.)"
    },
    {
      "lineNumber": 104620,
      "originalJapaneseLine": "（他の子の面倒見てくれてるのは確かだから、",
      "translatedEnglishLine": "(But it's true that she's taking care of the other kids,"
    }
  ]
}

